// Home.js
import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
    const [products, setProducts] = useState([]);
    const [loading, setLoading] = useState(true);

    useEffect(() => {
        fetch('https://fakestoreapi.com/products')
            .then((response) => response.json())
            .then((data) => {
                setProducts(data);
                setLoading(false);
            })
            .catch((error) => {
                console.error('Error fetching products:', error);
                setLoading(false);
            });
    }, []);

    if (loading) {
        return <div className="text-center mt-5">Loading products...</div>;
    }

    // Slice the products array to show only the first 4 products
    const displayedProducts = products.slice(0, 8);

    return (
        <div className="container mt-5 p-5">
            <header className="text-center mb-5">
                <h1>Welcome to ZENDO</h1>
                <p>Your one-stop shop for original clothing in Cambodia.</p>
                <p>Explore our exclusive collections from various brands!</p>
            </header>
            <div className="row mt-4">

                <h2 className='text-center text-uppercase'>Future </h2>
                {displayedProducts.map((product) => (
                    <div className="col-lg-3 col-md-6 mb-4" key={product.id}>
                        <div className="card h-100">
                            <img
                                src={product.image}
                                className="card-img-top"
                                alt={product.title}
                                style={{ height: '200px', objectFit: 'contain' }}
                            />
                            <div className="card-body d-flex flex-column">
                                <h5 className="card-title">{product.title}</h5>
                                <p className="card-text">${product.price}</p>
                                <div className="mt-auto">
                                    <Link to={`/product/${product.id}`} className="btn btn-primary">
                                        Shop Now
                                    </Link>
                                </div>
                            </div>
                        </div>
                    </div>
                ))}
            </div>
            {/* Services Section */}
            <section className="mt-5 bg-primary ">
                <h2 className="text-center mb-4">Our Services</h2>
                <div className="row p-4">
                    <div className="col-md-4 mb-4">
                        <div className="card text-center bg-success p-2 text-dark bg-opacity-75">
                            <div className="card-body">
                                <i className="fas fa-paint-brush fa-2x mb-3"></i>
                                <h5 className="card-title">Customization</h5>
                                <p className="card-text">Personalize your clothing with our customization options for a unique touch.</p>
                            </div>
                        </div>
                    </div>
                    <div className="col-md-4 mb-4">
                        <div className="card text-center">
                            <div className="card-body">
                                <i className="fas fa-truck fa-2x mb-3"></i>
                                <h5 className="card-title">Fast Delivery</h5>
                                <p className="card-text">Enjoy quick and reliable delivery services for your orders.</p>
                            </div>
                        </div>
                    </div>
                    <div className="col-md-4 mb-4">
                        <div className="card text-center">
                            <div className="card-body">
                                <i className="fas fa-headset fa-2x mb-3"></i>
                                <h5 className="card-title">Customer Support</h5>
                                <p className="card-text">Our dedicated support team is here to assist you with any inquiries.</p>
                            </div>
                        </div>
                    </div>
                </div>
            </section>

        </div>
    );
};

export default Home;
